a.getStatusByValue:
__ht__function(value) { 
     if(value === 254) {
            return {
                status: '正常',
                color: undefined
            }; 
        }
        else if(value >= 0 && value < 10) {
            return {
                status: '故障',
                color: 'rgb(242, 83, 75)'
            };
        }
        else if(value >= 10 && value < 20) {
            return {
                status: '异常',
                color: 'rgb(255, 165, 0)'
            };
        }
        else if(value === 255) {
            return {
                status: '未知',
                color: 'rgb(128, 128, 128)'
            };
        }
        else {
            return null;
        }
}
